import React from 'react';
import Dialog from 'material-ui/Dialog';
import {API_URL} from '../../store/axiosConfig';

/** Dialog to show disconnection from API */
export default class NetworkErrorScreen extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isOffline: false,
    }
  }

  componentWillMount() {
    let that = this;
    let apiRequest = () => {
      fetch(API_URL)
        .then(() => {
            if (that.state.isOffline) that.setState({isOffline:false});
        }).catch(e=> {
          if (!that.state.isOffline) that.setState({isOffline:true});
        });
    }
    setInterval(apiRequest, 5000);
  }

  render() {

    const imgSrc = "data:image/gif;base64,";
    const logo = <img src={imgSrc} alt="logo" style={{padding: 0}} width="45%"/> ;

    return (
      <Dialog
        open={this.state.isOffline}
        style={{zIndex: 2500}}
        contentStyle={{width: "25%", padding: 0, position:"fixed", top:"15%", left:"37.5%"}}
        title="Uh-oh! Network Error"
      >
        <div style={{textAlign:"center", paddingBottom:"1.5em"}}>
          {logo}
          <br />
          Cannot connect to VisColl. Trying to re-connect..
        </div>
      </Dialog>
    );
  }
}